Asset.description:
Asset is an XDR Union defined as:

```text union Asset switch (AssetType type) { case ASSET_TYPE_NATIVE: // Not credit void;

case ASSET_TYPE_CREDIT_ALPHANUM4: AlphaNum4 alphaNum4;

case ASSET_TYPE_CREDIT_ALPHANUM12: AlphaNum12 alphaNum12;

// add other asset types here in the future }; ```

ClaimLiquidityAtom.description:
ClaimLiquidityAtom is an XDR Struct defined as:

```text struct ClaimLiquidityAtom { PoolID liquidityPoolID;

// amount and asset taken from the pool Asset assetSold; int64 amountSold;

// amount and asset sent to the pool Asset assetBought; int64 amountBought; }; ```

ClaimOfferAtom.description:
ClaimOfferAtom is an XDR Struct defined as:

```text struct ClaimOfferAtom { // emitted to identify the offer AccountID sellerID; // Account that owns the offer int64 offerID;

// amount and asset taken from the owner Asset assetSold; int64 amountSold;

// amount and asset sent to the owner Asset assetBought; int64 amountBought; }; ```

ClaimOfferAtomV0.description:
ClaimOfferAtomV0 is an XDR Struct defined as:

```text struct ClaimOfferAtomV0 { // emitted to identify the offer uint256 sellerEd25519; // Account that owns the offer int64 offerID;

// amount and asset taken from the owner Asset assetSold; int64 amountSold;

// amount and asset sent to the owner Asset assetBought; int64 amountBought; }; ```

InnerTransactionResult.description:
InnerTransactionResult is an XDR Struct defined as:

```text struct InnerTransactionResult { // Always 0. Here for binary compatibility. int64 feeCharged;

union switch (TransactionResultCode code) { // txFEE_BUMP_INNER_SUCCESS is not included case txSUCCESS: case txFAILED: OperationResult results<>; case txTOO_EARLY: case txTOO_LATE: case txMISSING_OPERATION: case txBAD_SEQ: case txBAD_AUTH: case txINSUFFICIENT_BALANCE: case txNO_ACCOUNT: case txINSUFFICIENT_FEE: case txBAD_AUTH_EXTRA: case txINTERNAL_ERROR: case txNOT_SUPPORTED: // txFEE_BUMP_INNER_FAILED is not included case txBAD_SPONSORSHIP: case txBAD_MIN_SEQ_AGE_OR_GAP: case txMALFORMED: case txSOROBAN_INVALID: void; } result;

// reserved for future use union switch (int v) { case 0: void; } ext; }; ```

ManageOfferSuccessResult.description:
ManageOfferSuccessResult is an XDR Struct defined as:

```text struct ManageOfferSuccessResult { // offers that got claimed while creating this offer ClaimAtom offersClaimed<>;

union switch (ManageOfferEffect effect) { case MANAGE_OFFER_CREATED: case MANAGE_OFFER_UPDATED: OfferEntry offer; case MANAGE_OFFER_DELETED: void; } offer; }; ```

OfferEntry.description:
OfferEntry is an XDR Struct defined as:

```text struct OfferEntry { AccountID sellerID; int64 offerID; Asset selling; // A Asset buying;  // B int64 amount;  // amount of A

/* price for this offer: price of A in terms of B price=AmountB/AmountA=priceNumerator/priceDenominator price is after fees */ Price price; uint32 flags; // see OfferEntryFlags

// reserved for future use union switch (int v) { case 0: void; } ext; }; ```
